  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Management Plan will
  provide the framework for making decisions on conserving natural, cultural, and
  recreational resources, managing visitor use, developing facilities and addressing
  administrative operations of Rocky Mountain Arsenal National Wildlife Refuge.  The
  U.S. Fish and Wildlife Service (Service) has developed this Comprehensive Management
  Plan to provide alternatives and identify consequences for the management and use
  of Rocky Mountain Arsenal National Wildlife Refuge. The Comprehensive Management
  Plan outlines issues, concerns and opportunities expressed to the Service during
  scoping meetings, public open houses, newsletter appeals, and other means. Topics
  addressed in this plan include; wildlife protection, habitat conservation, wilderness
  areas, visitor services, natural and cultural resources, physical environment, fire
  management, and Refuge administration.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
